vl=57,u=1101}),i(18375,{b=1,f=5,lvl=57,u=1101}),i(18380,{b=1,f=7,lvl=57,u=1101}),i(18378,{b=1,f=6,lvl=57,u=1101}),i(18395,{b=1,f=52,lvl=57,u=1101})}})}})}}),inst(231,{coords={{30.11,74.64,30}},lore="Located in Dun Morogh, the technological wonder known as Gnomeregan has been the gnomes' capital city for generations. Recently, a hostile race of mutant troggs infested several regions of Dun Morogh - including the great gnome city. In a desperate attempt to destroy the invading troggs, High Tinker Mekkatorque ordered the emergency venting of the city's radioactive waste tanks. Several gnomes sought shelter from the airborne pollutants as they waited for the troggs to die or flee. Unfortunately, though the troggs became irradiated from the toxic assault - their siege continued, unabated. Those gnomes who were not killed by noxious seepage were forced to flee, seeking refuge in the nearby dwarven city of Ironforge. There, High Tinker Mekkatorque set out to enlist brave souls to help his people reclaim their beloved city.\n\nIt is rumored that Mekkatorque's once-trusted advisor, Mekgineer Thermaplug, betrayed his people by allowing the invasion to happen. Now, his sanity shattered, Thermaplug remains in Gnomeregan - furthering his dark schemes and acting as the city's new techno-overlord.",lvl=19,mapID=226,maps={227,228,229},g={n(-1000029,{q(2904,{lvl=20,qgs={7850},rwp=40003,g={i(9536,{b=1,f=4,rwp=40003}),i(9535,{b=1,f=6,rwp=40003})}}),q(2931,{coords={{59.6,67,1442}},isBreadcrumb=1,lvl=25,nextQuests={2930},qgs={4077},r=2,rwp=40003}),q(2842,{coords={{75.6,25.2,1454}},description="You cannot get this quest until you accept the Rig Wars quest. Accept Rig Wars, then this guy gives you the quest to get to Gnomer safely...",lvl=20,qgs={3413},r=1,rwp=40003}),q(2930,{coords={{70.2,48.4,1455}},lvl=25,qgs={7950},r=2,rwp=40003,sourceQuests={2931},g={qo(1,{providers={{"i",9316}}}),i(9604,{b=1,f=24,rwp=40003}),i(9605,{b=1,f=3,rwp=40003})}}),q(2924,{coords={{68.2,46.2,1455}},lvl=24,qgs