d in Classic. If you get this item in Classic Era or Wrath Classic, please screenshot this and send it directly to @crieve on Discord!",f=6,lvl=57,rwp=20001}),i(13398,{b=1,f=5,lvl=57,rwp=50004}),i(22433,{b=1,f=52,lvl=58,rwp=50004,u=15}),i(19276,{rwp=50004,u=13})}})}}),inst(64,{coords={{36.6,65.6,1421}},lore="During the Third War, the wizards of the Kirin Tor battled against the undead armies of the Scourge. When the wizards of Dalaran died in battle, they would rise soon after - adding their former might to the growing Scourge. Frustrated by their lack of progress (and against the advice of his peers) the Archmage, Arugal elected to summon extra-dimensional entities to bolster Dalaran's diminishing ranks. Arugal's summoning brought the ravenous worgen into the world of Azeroth. The feral wolf-men slaughtered not only the Scourge, but quickly turned on the wizards themselves. The worgen sieged the keep of the noble, Baron Silverlaine. Situated above the tiny hamlet of Pyrewood, the keep quickly fell into shadow and ruin. Driven mad with guilt, Arugal adopted the worgen as his children and retreated to the newly dubbed 'Shadowfang Keep'. It's said he still resides there, protected by his massive pet, Fenrus - and haunted by the vengeful ghost of Baron Silverlaine.",lvl=14,mapID=310,maps={311,312,313,314,315,316},g={n(-1000029,{q(1014,{coords={{44.2,39.8,1421}},lvl=18,qgs={1938},r=1,rwp=40003,g={qo(1,{providers={{"i",5442}}}),i(6414,{b=1,f=52,rwp=40003})}}),q(1098,{coords={a[99]},lvl=18,qgs={1952},r=1,rwp=40003,g={i(3324,{b=1,f=4,rwp=40003})}}),q(1013,{coords={{54,54.6,1458}},lvl=16,qgs={2934},r=1,rwp=40003,g={qo(1,{providers={{"i",6283}}}),i(4534,{b=1,f=6,rwp=40003}),i(6335,{b=1,f=5,rwp=40003})}}),q(1740,{c=a[160],coords={{49.2,57.2,1413}},lvl=20,maps={221},qgs={6247},rwp=40003,g={qo(1,{providers={{"i",6914}}}),qo(2,{providers={{"i",6915}}}),i(6898,{b=1,c=a[160],f=1,rwp=40003}),i(15109,{b=1,c=a[160],f=28,rwp=40003})}})}),n(-1000042,{i(1935,{b=2,f=20,lvl=19}),i(3194,{b