 city. The two sides are locked in constant, violent combat. Those adventurers brave (or foolish) enough to enter Stratholme will be forced to contend with both factions before long. It is said that the city is guarded by three massive watchtowers, as well as powerful necromancers, banshees and abominations. There have also been reports of a malefic Death Knight riding atop an unholy steed, dispensing indiscriminate wrath on all those who venture within the realm of the Scourge.",lvl=48,mapID=317,g={n(-1000004,{ach(646,{sourceQuests={5263}})}),n(-1000029,{q(5263,{coords={a[153]},lvl=55,qgs={11039},rwp=40003,sourceQuests={5262},g={qo(1,{providers={{"i",13251}}})}}),q(5125,{cost={{"i",12845,1}},qgs={10917},rwp=40003,sourceQuests={5122},g={i(17044,{b=1,f=51,rwp=40003}),i(17045,{b=1,f=52,rwp=40003})}}),q(5861,{coords={{7.6,43.6,1423}},lvl=52,providers={{"i",14872}},qgs={1855},rwp=40003,sourceQuests={5848}}),q(5243,{coords={{81.6,57.8,1423}},cost={{"i",13180,5}},description="When mousing over the crates, look for 'Requires: Disarm Trap'. If you see this, it's a trap and shouldn't be touched.\n\nIf you are a dwarf, use find treasure and on the mini map it will show a dot for the holy water in the crate. It will only show crates with items in it on the mini map and not bad crates.",lvl=55,qgs={11036},rwp=40003,g={i(13216,{b=1,f=4,rwp=40003}),i(13217,{b=1,f=52,rwp=40003}),i(6149,{f=55,lvl=31}),i(3928,{f=55,lvl=35})}}),q(5944,{coords={{42,14.8,1422}},lvl=52,qgs={1842},rwp=40003,sourceQuests={5862},g={i(15418,{b=1,f=24,rwp=40003}),i(15411,{b=1,f=51,rwp=40003}),i(15421,{b=1,f=3,rwp=40003}),i(15413,{b=1,f=7,rwp=40003}),i(16058,{b=1,f=52,rwp=40003})}}),q(5264,{coords={a[153]},lvl=55,qgs={11039},rwp=40003,sourceQuests={5263}}),q(5781,{coords={{7.4,43.6,1423}},lvl=52,qgs={1855},rwp=40003,sourceQuests={5742},g={qo(1,{coords={{29.8,85.6,1423}},crs={11886},providers={{"i",14613}}})}}),q(5845,{coords={{7.4,43.6,1423}},lvl=52,qgs={1855},rwp=40003,sourceQuests={5781},g={qo(1,{coords={{7