(237,{coords={{69.2,54.8,1435}},lore="Over a thousand years ago, the powerful Gurubashi Empire was torn apart by a massive civil war. An influential group of troll priests, known as the Atal'ai, attempted to bring back an ancient blood god named Hakkar the Soulflayer. Though the priests were defeated and ultimately exiled, the great troll empire buckled in upon itself. The exiled priests fled far to the north, into the Swamp of Sorrows. There they erected a great temple to Hakkar - where they could prepare for his arrival into the physical world. The great dragon Aspect, Ysera, learned of the Atal'ai's plans and smashed the temple beneath the marshes. To this day, the temple's drowned ruins are guarded by the green dragons who prevent anyone from getting in or out. However, it is believed that some of the fanatical Atal'ai may have survived Ysera's wrath - and recommitted themselves to the dark service of Hakkar.",lvl=45,mapID=220,sins={"Sunken Temple"},g={n(-1000029,{q(9053,{c=a[9],coords={{71.6,76,1449}},lvl=50,qgs={9619},rwp=40003,sourceQuests={9051},u=14,g={qo(1,{providers={{"i",22444}},u=14}),i(22458,{b=1,f=28,rwp=40003,u=14}),i(22272,{b=1,f=5,rwp=40003,u=14}),i(22274,{b=1,f=5,rwp=40003,u=14})}}),q(8257,{c=a[112],coords={{42.2,42.6,1447}},lvl=50,qgs={8405},rwp=40003,sourceQuests={8256},u=14,g={qo(1,{crs={5719},providers={{"i",20025}},u=14}),i(19990,{b=1,f=53,rwp=40003,u=14}),i(20006,{b=1,f=52,rwp=40003,u=14}),i(20082,{b=1,f=27,rwp=40003,u=14})}}),q(8413,{c=a[139],coords={{80.4,66.8,1416}},lvl=50,qgs={6176},r=1,rwp=40003,sourceQuests={8412},u=14,g={qo(1,{providers={{"i",20606}},u=14}),qo(2,{providers={{"i",20607}},u=14}),qo(3,{providers={{"i",20608}},u=14}),i(20369,{b=1,f=6,rwp=40003,u=14}),i(20503,{b=1,f=53,rwp=40003,u=14}),i(20556,{b=1,f=28,rwp=40003,u=14})}}),q(8253,{c=a[146],coords={{29.6,40.6,1447}},lvl=50,qgs={8379},rwp=40003,sourceQuests={8252},u=14,g={qo(1,{crs={5719},providers={{"i",20085}},u=14}),i(20035,{b=1,f=20,rwp=40003,u=14}),i(20036,{b=1,f=53,rwp