m(1414,{lore="Kalimdor is home to the night elves, orcs, tauren, trolls, and draenei. Other races present include the ogres, centaur, naga, demons, and other, more minor races.",maps={1464},g={n(-1000004,{ach(1678,{description="Complete 640 quests in Kalimdor.",OnClick=_.CommonAchievementHandlers.LOREMASTER_CONTINENT_OnClick,OnTooltip=_.CommonAchievementHandlers.LOREMASTER_OnTooltip,OnUpdate=function(t) return _.CommonAchievementHandlers.LOREMASTER_CONTINENT_OnUpdate(t, 1414); end,r=2,rank=640}),ach(1680,{description="Complete 625 quests in Kalimdor.",OnClick=_.CommonAchievementHandlers.LOREMASTER_CONTINENT_OnClick,OnTooltip=_.CommonAchievementHandlers.LOREMASTER_OnTooltip,OnUpdate=function(t) return _.CommonAchievementHandlers.LOREMASTER_CONTINENT_OnUpdate(t, 1414); end,r=1,rank=625,rwp=40003})}),m(1457,{isRaid=1,lore="The atmosphere inside the city is quiet and tranquil. It does not have the feeling of confinement that one would feel in Stormwind or Ironforge, where the buildings are grouped close together. Darnassus is open to the sky, and the graceful bridges spanning the lake around which it is built set the buildings wide apart. The elegant bridges, beautiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history.",g={n(-1000019,{faction(69,{icon=_.asset("Achievement_C