)}})}}),m(1453,{isRaid=1,lore="Stormwind City is the capital city of the Alliance. It is located in the northwestern part of Elwynn Forest.\n\nDuring the First War, the Kingdom of Azeroth, including its capital, Stormwind Keep, was utterly destroyed by the Horde and its survivors fled to Lordaeron. After the orcs were defeated at the Dark Portal at the end of the Second War, it was decided that the city would be rebuilt. The nobles of Stormwind assembled a team of the most skilled and ingenious stonemasons and architects they could find--which later turned sour and led to the rise of the Defias.\n\nWith the fall of the northern kingdoms, Stormwind is by far the most populated city in the world. It serves in many ways as the cultural and trade center of the Alliance, even with remote access to the sea. It is home to the Academy of Arcane Sciences, the only wizarding school in Eastern Kingdoms, as well as SI:7, a rogue intelligence organization.",g={n(-1000004),n(-1000019,{faction(72,{icon=_.asset("Achievement_Character_Human_Female"),OnTooltip=function(t)	local reputation = t.reputation;	if reputation < 42000 then	local isHuman = _.RaceIndex == 1;	local repPerTurnIn = isHuman and 55 or 50;	local x, n = math.ceil((42000 - reputation) / repPerTurnIn), math.ceil(42000 / repPerTurnIn);	GameTooltip:AddDoubleLine("Runecloth Turn Ins", (n - x) .. " / " .. n .. " (" .. x .. ")", 1, 1, 1);	end	end,r=2})}),n(-1000020,{fp(2,{coords={{66.2,62.4,1453}},crs={352},r=2})}),n(-1000028,{prof(164,{n(5511,{coords={{57,16.6,1453}},r=2,g={r(2018,{rank=1,requireSkill=164}),r(3100,{rank=2,requireSkill=164,rwp=80001}),r(3538,{rank=3,requireSkill=164,rwp=80001}),n(-1000058,{r(2661,{requireSkill=164}),r(3319,{requireSkill=164}),r(2663,{requireSkill=164}),r(2662,{requireSkill=164}),r(7223,{requireSkill=164}),r(3501,{requireSkill=164}),r(3508,{requireSkill=164}),r(3502,{requireSkill=164}),r(3506,{requireSkill=164}),r(9928,{requireSkill=164}),r(9926,{requireSkill=164}),r(2672,{requireSkill=164}),