 to the west, the Eastern Plaguelands to the east, and the Alterac Mountains to the south. It is filled with a smoky gray mist and the creatures here are blighted and sick, angrily attacking anyone who wanders too close with surprising ferocity. The land is also home to countless undead who infest the ruins of Andorhal, the four cauldron fields, and Sorrow Hill. The Scarlet Crusade has a significant holding in and around Hearthglen to the north, and the Alliance has settled in the small Chillwind Camp to the south.\n\nLike their eastern counterparts, the Western Plaguelands were once fertile and beautiful but are now gray, blighted and noxious. Undead wander the land and haunt the abandoned towns and farmsteads. The largest Scourge city here is Andorhal, beneath which is an underground complex housing the undead's School of Necromancy. The Scarlet Crusade strikes against the Scourge from Hearthglen. The only place of any sanity in the Western Plaguelands is Uther's Tomb, a consecrated monument to the fallen hero Uther Lightbringer.",g={n(-1000004,{ach(770,{description="Explore Western Plaguelands, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-1000018,{exp(200,{maphash="220:150:381:265"}),exp(193,{maphash="285:230:260:355"}),exp(190,{maphash="340:288:307:16"}),exp(2620,{maphash="205:340:590:86"}),exp(199,{maphash="160:125:300:311"}),exp(198,{maphash="160:200:566:198"}),exp(197,{maphash="300:206:355:462"}),exp(813,{maphash="225:185:137:293"}),exp(2297,{maphash="370:270:504:343"}),exp(201,{maphash="180:205:520:250"}),exp(202,{maphash="170:190:451:323"}),exp(2298,{maphash="170:165:600:412"}),exp(192,{maphash="220:180:382:164"})}),n(-1000020,{fp(66,{coords={{42.8,85,1422}},crs={12596},r=2})}),n(-1000029,{q(5066,{coords={{54.8,62.6,1453}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={2198},r=2,rwp=40003}),q(5090,{coords={{31.6,67,1455}},isBreadcrumb=1,l