 and ponds. Bordered on three sides by mountains, the Wetlands are open to the ocean to the west. Adventurers seeking a route to the Wetlands must either come through sieged Dun Algaz from Loch Modan or cross the damaged Thandol Span from Arathi Highlands. The northern slopes of Wetlands are generally classed within mountains of Khaz Modan.\n\nThe Wetlands is a vast, cold swamp. Mists cloak the ground, and the overcast sky makes the land a uniform gray. Many Ironforge strongholds once stood in this region, but war has reduced them to rubble. Wild creatures, murlocs and renegade orcs now control the land. Menethil Harbor, a city on the west coast, is the Alliance's only presence in this dreary region.",g={n(-1000004,{ach(841,{description="Explore Wetlands, revealing the covered areas of the world map.",OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-1000018,{exp(1016,{maphash="256:250:507:115"}),exp(1017,{maphash="190:160:628:176"}),exp(1024,{maphash="300:240:92:82"}),exp(1038,{maphash="350:360:611:230"}),exp(1023,{maphash="200:240:237:41"}),exp(1025,{maphash="185:240:456:125"}),exp(1020,{maphash="205:245:527:264"}),exp(1018,{maphash="240:175:77:245"}),exp(1022,{maphash="225:190:89:142"}),exp(118,{maphash="195:185:247:205"}),exp(309,{maphash="200:185:349:115"}),exp(1021,{maphash="230:190:470:371"}),exp(1036,{maphash="225:185:347:218"}),exp(205,{maphash="205:180:401:21"}),exp(150,{maphash="175:128:13:314"})}),n(-1000020,{fp(7,{coords={{9.6,59.6,1437}},crs={1571},r=2})}),n(-1000029,{q(304,{coords={{49.8,18.3,1437}},lvl=26,qgs={1071},r=2,rwp=40003,g={qo(1,{coords={{47.4,15,1437},{46.6,18.6,1437},{61.8,31,1437}},crs={1364},providers={{"i",3639}}}),i(2916,{b=1,f=8,rwp=40003}),i(2917,{b=1,f=52,rwp=40003})}}),q(471,{coords={{8.5,55.7,1437}},lvl=18,qgs={2094},r=2,rwp=40003,sourceQuests={484},g={qo(1,{crs={2089},providers={{"i",3348}}}),i(2545,{b=1,f=6,filterForRWP=7,rwp=40003}),i(3561,{b=1,f=3,rwp=40003